from sympy import isprime, primefactors as pf
def aupton(terms):
  alst, aset = [2], {2}
  for n in range(2, terms+1):
    m, prevpf = 4, set(pf(alst[-1]))
    while m in aset or isprime(m) or set(pf(m)) & prevpf != set(): m += 1
    alst.append(m); aset.add(m)
  return alst
